function App() {

  const {User}= useData()

  return(
    <div className="App">
    <Navbar />
    <div className="pages">
      <Routes>

        <Route path="/" element={<Home />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path='*' element={<h1 style={{position:'absolute', top:'0', height:'100vh', width:'100vw', backgroundColor:'white'}}>
